import React from 'react';
import { Card } from 'react-bootstrap';
import { StockTypes } from './data';
import './widget.css'

interface StockProps {
    info: StockTypes;
};

const StatisticsWidget = ({ info }: StockProps) => {
    let img_url = "https://storage.googleapis.com/iex/api/logos/" + info.symbol + ".png";
    return (
        // <Card className="card">
        //     <div className="card-logo">
        //         <img src={img_url} alt="stock img" />
        //     </div>
        //     <Card.Body className="card-info">
        //         <div className="card-symbol">{info.symbol}</div>
        //         <Card.Subtitle className="card-name">{info.name}</Card.Subtitle>
        //     </Card.Body>
        //     <div className="d-flex flex-column text-right">
        //         <div className="card-price">{info.price}</div>
        //     </div>
        //     <div className="d-flex justify-content-end align-items-center">
        //         <div className="card-change">{info.change}</div>
        //         <div className="card-percent">{info.percent_change}</div>
        //     </div>
        // </Card>
        <Card className="card-container">
            <div className="card-logo rounded-circle">
                <img src={img_url} alt="" />
            </div>
            <div className="card-info">
                <Card.Title as="h4" className="card-symbol">{info.symbol}</Card.Title>
                <Card.Text as="small" className="card-name text-muted">{info.name}</Card.Text>
            </div>
            <div className="d-flex flex-column text-right">
                <div className="card-price">{info.price}</div>
                <div className={`d-flex justify-content-end align-items-center card-change`}>
                    <div className="mr-2">{info.change}</div>
                    <div>{info.percent_change}%</div>
                </div>
            </div>
        </Card>
    );
};

export default StatisticsWidget;
